/*
  Author: Hayden Stegman
*/
import React from 'react';
import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Button, Text, View } from 'react-native';
import { NavigationContainer, useNavigation } from '@react-navigation/native';
import { RootStackParamList } from './RootStackParamList';
import { StackNavigationProp } from '@react-navigation/native';

type landlordScreenProp = StackNavigationProp<RootStackParamList, 'LandlordPage'>

/* 
  Landlord Screen
*/
const LandlordPageScreen = () => {
    const navigation = useNavigation<landlordScreenProp>();
        return (
        <View style={styles.container}>
        <Text>Landlord 1 Page</Text>
        <StatusBar style="auto" />

        <Button
            title="Home"
            onPress={() =>
            navigation.navigate('HomePage')
            }
        />
        </View>
    );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
